import React, { useState, useEffect } from 'react'
import NavbarAdmin from '../../layouts/NavbarAdmin'
import { useSelector } from 'react-redux'

const initialstate = {
	dorm:"",
	roomID:"",
	floor:"",
	room:"",
	roomtype:"",
	price:"",
	images:[],
}

const AdminCreateDormRoom = () => {
	const { user } = useSelector((state)=>({...state}))
	const [values,setValues] = useState(initialstate)
	
	const handleChangeDorm = (e) => {
    setValues({
      ...values,
      [e.target.name]: e.target.value,
    })
  }
	
	return (
		<div>
			<NavbarAdmin />
			<h3>เพิ่มห้องพัก</h3>
			<form>
				<div className='form-group'>
					<div className="col-md-6">
              <label className="col-form-label">หมายเลขห้อง</label>
              <input type="text" className="form-control" name="name" placeholder="หมายเลขห้อง" value={values.name} onChange={handleChangeDorm} />
            </div>
				</div>
			</form>
		</div>
	)
}

export default AdminCreateDormRoom
